import React from 'react'
import {NavLink} from 'react-router-dom'
const Nav = () => {
  return (
    <>
    <hr />
    <section className="donate">
        <button className="donate1">Donate Us</button>
    </section>

    <nav>
      <ul>
        <NavLink to='/' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
        </NavLink>
        <NavLink to='/home' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>About Us</li>
        </NavLink>
        <NavLink to='/about-us' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>Contacts</li>
        </NavLink>
        <NavLink to='/contacts' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
        </NavLink>
      </ul>
    </nav>
    </>
  )
}

export default Nav
